import { useState  } from "react";
import "./index.css";

const Login = () => {
    const [ user, setUser ] = useState({
        email: "",
        password: ""
    });

    const handleInputChange = (e) => {
        setUser(e.target.value);
    };

    return (
        <div className="bg__login">             
            <div 
                className="d-flex justify-content-center align-items-center"
                style={{
                    height: "100vh"
                }}
                >
                    <div className="card text-center p-3 opacity-95">
                        <h1> Login </h1>
                        <div className="form-outline mb-4">
                            <input type="email" id="form2Example1" className="form-control" placeholder="Email address" />                          
                        </div>

                        <div className="form-outline mb-4">
                            <input type="password" id="form2Example2" className="form-control" placeholder="Password"/>
                        </div>

                        <div className="row mb-4">
                            <div className="col d-flex justify-content-center">

                            <div className="form-check">
                                <input className="form-check-input" type="checkbox" value="" id="form2Example31" checked />
                                <label className="form-check-label" for="form2Example31"> Remember me </label>
                            </div>
                            </div>

                            <div className="col">

                            <a href="#!">Forgot password?</a>
                            </div>
                        </div>

                        <button type="button" className="btn btn-primary btn-block mb-4">Sign in</button>

                        <div className="text-center">
                            <p>Not a member? <a href="#!">Register</a></p>
                            <p>or sign up with:</p>
                            <button type="button" className="btn btn-link btn-floating mx-1">
                            <i className="fab fa-facebook-f"></i>
                            </button>

                            <button type="button" className="btn btn-link btn-floating mx-1">
                            <i className="fab fa-google"></i>
                            </button>

                            <button type="button" className="btn btn-link btn-floating mx-1">
                            <i className="fab fa-twitter"></i>
                            </button>

                            <button type="button" className="btn btn-link btn-floating mx-1">
                            <i className="fab fa-github"></i>
                            </button>
                        </div>
                    </div>
            </div>
        </div>
    );
};

export default Login;
